import React, { Component } from 'react';
import { Table } from 'reactstrap';
import axios from 'axios';
import Buttons from './ButtonComponent';

class TableComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: {}
        };
        this.getData = this.getData.bind(this);
    }

    componentWillMount() {
        this.getData();
    }

    async getData() {
        const data = await axios.get("http://localhost:8000/api/deliveries.php")
            .catch(error => {
                console.log(error);
            });

        this.setState({
            data: data.data
        });

        console.log(data);
        console.log(data.data);
    }

    render() {
        let deliveries = this.state.data;
        console.log(this.state.data);
        console.log('asdiauhsdahsdu');
        return (
            <div>
                <h1>Deliveries</h1>
                <Table className="table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Driver</th>
                            <th>&nbsp;</th>
                        </tr>
                    </thead>
                    <tbody>

                        {Object.keys(deliveries).map((id, i) => (
                            <tr>
                                <th scope="row" key={i}>{id}</th>
                            {
                                /* <td key = {i}>{item.date}</td>
                                <td key = {i}>{item.name}</td>
                                <td key = {i}>{item.driver_id}</td> */
                            }
                            <Buttons getData={this.getData} />
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </div>
        );
    }
}

export default TableComponent;
